import React from "react";

export default class EntityFieldGroups extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        if (this.props.sections) {
            return (
                <h1>{this.props.sections.length}</h1>
            );
        } else {
            // loading screen
            return (
                <svg path="../assets/" width={100} height={100}>
                    <circle cx={50} cy={50} r={40} stroke="green" strokeWidth={4} fill="yellow" />

                    <text x={50} y={50} textAnchor="middle" alignmentBaseline="central" fill="black" fontSize="20">
                        Loading...
                    </text>
                </svg>
            );
        }
    }
}
